    type: "FIRST"
});

export const second = () => ({
    type: "SECOND"
});

export const third = () => ({
    type: "THIRD"
});

export const switchSection = filter => ({
    type: "SWITCH",
    filter
});

export const prevSection = () => ({
    type: "PREV"
});

export const nextSection = () => ({
    type: "NEXT"
});

export const SwitchFilters = {
  FIRST: 0,
  SECOND: 1,
  THIRD: 2
};
